function getColor(pValue) {
	var red = 255;
	var green = 255;
	if (pValue >= 5) {
		green = 255;
		red = 255 - Math.pow((pValue / 100 - 0.05) * 1 / 0.05, 2) * 255;
	} else {
		green = Math.pow(pValue / 100 * 1 / 0.05, 2) * 255;
		red = 255;
	}
	return 'rgba(' + red + ',' + green + ',0,0.2)';
}